sys_variable_value.value:
(function execute(inputs, outputs) {
    if (inputs.statuscode == "202") {
        try {
            outputs.status = "Success";
        } catch (ex) {
            throw new Error('JSON Parse Error. Response Body may be empty.');
        }
    } else {
        var errMsgs = new OciObjectStorageManagement_ErrorHandler().errorHandler(inputs.responseBody);
        outputs.error_message = errMsgs[0];
        outputs.status = errMsgs[1];
    }
})(inputs, outputs);

